import React from "react";
import "antd/dist/antd.css";
import { Col, Button, Row, Input } from 'antd';
import { PlusOutlined } from '@ant-design/icons';

function App() {
  return (
    <Row className="ant-row">
      <Col className="ant-col">
        <Input placeholder="Nome"/>
        <Button 
        type="danger"
        size="large"
        icon={<PlusOutlined />}
        >
          Adicionar
          </Button>
      </Col>
    </Row>
  );
}

export default App;
